resources.string:
Zorg ervoor dat:

• uw voertuig is ingeschakeld;
• de transmissie in de stand Park is geschakeld;
• de remmen niet worden bekrachtigd;
• de alarmknipperlichten en richtingaanwijzers uit zijn.

plurals.item:
Deze update duurt maximaal %1$s minuten. Gedurende deze tijd:
• kan uw voertuig niet rijden of ingeschakeld worden, parkeer daarom op een veilige plaats;
• werken bv. portiervergrendelingen, ramen en geluidssignalen mogelijk niet;
• kan men vergrendelde portieren mogelijk niet ontgrendelen, sluit daarom geen passagiers op bij het verlaten.

